import React from "react";
import './Superior.css'

class Superior extends React.Component{
    render(){
        return(
            <div>
            <header id='Header'>
              <div></div>
              <div id='log'>
                <img src='/img/usuario50.jpg' alt='' />LOGIN
              </div>
              <div id='fecha' >
                <input id="fechas" class="date" type="date" value="22-12-01" ></input>
              </div>
            </header>
          </div>
        )
    }
}
export default Superior;
